import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Alert, StyleSheet, Text, View, TouchableWithoutFeedback, Image, SafeAreaView, TouchableOpacity, TouchableHighlight, Button } from 'react-native';

export default function App() {
  return (
    <SafeAreaView style={styles.container}>
      <Button color='tomato' title="Click Me" 
      onPress={()=>Alert.alert("My title", "My message here", [
        {text: "Yes"},
        {text:"No"},
      ])}/>
    </SafeAreaView>
  ); 
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
